import {FC, ReactElement, SVGProps} from 'react';
import {cx} from '@emotion/css';
import {css, SerializedStyles} from '@emotion/react';
import type {TestableComponent} from '../../models/dom';

/**
 * The `MobileLogoProps` interface represents the props accepted by the `MobileLogo` component.
 */
export interface MobileLogoProps extends SVGProps<SVGSVGElement>, TestableComponent {
  /**
   * The alternative text for the logo.
   */
  alt: string;
}

/**
 * CSS for the `Logo` component.
 */
const mobileLogoCss: SerializedStyles = css`
  /* Custom styles go here */
`;

/**
 * `MobileLogo` is a React component that displays Brion Mario's logo.
 *
 * Usage:
 *
 * ```jsx
 * <MobileLogo
 *   alt="Site Logo"
 * />
 * ```
 *
 * @param props - Props for the component.
 * @returns MobileLogo as a React component.
 */
const MobileLogo: FC<MobileLogoProps> = ({
  alt = '',
  height = 32,
  className = '',
  width = 'auto',
  ...rest
}: MobileLogoProps): ReactElement => (
  <svg
    className={cx('brionmario-mobile-logo', className)}
    width={width}
    height={height}
    viewBox="0 0 40 40"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    css={mobileLogoCss}
    {...rest}
  >
    {alt && <title>{alt}</title>}
    <rect x="3" y="3" width="35" height="35" fill="url(#pattern0)" />
    <defs>
      <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
        <use xlinkHref="#image0_1055_20" transform="scale(0.0023753)" />
      </pattern>
      <image
        id="image0_1055_20"
        width="421"
        height="421"
        xlinkHref="data:image/png;base64,"
      />
    </defs>
  </svg>
);

export default MobileLogo;
